import React from 'react';

function StatusLine (props) {
  console.log(props.indicatorStatus)
  return (
    <div className="statusLayout">
    {!props.indicatorStatus ?
      <div className="static">
        {props.valueStatus}
      </div> : <input value={props.valueStatus} onChange={changeValueStatus}></input>
    }
    </div>
  )
}

export default StatusLine
